class Solution:
    def minCut(self, s: str) -> int:
        n = len(s)
        dp = [0] * n
        pal = [[False] * n for _ in range(n)]

        for i in range(n):
            min_cut = i
            for j in range(i + 1):
                if s[j] == s[i] and (i - j <= 1 or pal[j + 1][i - 1]):
                    pal[j][i] = True
                    if j == 0:
                        min_cut = 0
                    else:
                        min_cut = min(min_cut, dp[j - 1] + 1)
            dp[i] = min_cut

        return dp[-1]
